import React from "react" ; 

class RadioButton extends React.Component{
    render(){
        
        return (
            <div className="tc">
                <input
                    type="radio"
                    name="react-tips"
                    value="Hello"
                    checked={false}
                    className="form-check-input"/>
                                    
            </div>
            ) ;
    }
}

export default RadioButton ;
